  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  return (
    <PageTemplate title='Sign In'>
      <form className='form'>
        <Input type='text' placeholder='Yoour email' value='123' label='email' onChange={setEmail}/>
        <Input type='text' placeholder='Yoour password' value='qwe' label='password' onChange={setPassword}/>
        <button className='signInBtn'>Sign In</button>
      </form>
    </PageTemplate>
  )
}

export default SignIn
